    super(props)
    }


  render(){
   return(
                  <div>
                  <div> <h2 style={{textAlign:"center"}}> Image Cartoonization </h2> </div>
                  <div className="Photo">
                    <img src="laptop.png" style={{"height": "100%", "width": "50%", border:"3px solid aliceblue"}} alt="Image of my computer"/>
                  </div>
                  <Row style={{justifyContent:"center", marginTop:"5px"}}>
                  </Row>
                  <div style={{textAlign:"left"}}> <br/> One </div>

              </div>
                  )
}
